import axios from "axios";

export const sendPhotoAttachment = (photos, props) => {
  console.log(photos);
  const data = new FormData();

  Object.keys(photos).forEach((key) => {
    console.log(photos[0]);
    const item = photos.item(key);
    data.append(item.name, item);
  });

  Object.keys(props).forEach((key) => {
    const item = props[key];
    data.append(`${key}`, item);
  });

  axios
    .post(`forms/attachPhoto`, data, { withCredentials: true })
    .then((res) => {
      console.log("success");
    })
    .catch((err) => {
      console.log(err);
    });
};
